import React from 'react'

function SettingImageWithAbsoultValue({imgUrl, top="auto", bottom="auto", right="auto", left="auto"}) {
  return (
    <img src={imgUrl} alt="#" />
  )
}

export default SettingImageWithAbsoultValue
